import './App.css';
import Home from './Pages/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (

    <Router>
      <Route exact path="/" element={<Home/>} />

    </Router>
  );
}

export default App;
